import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div  class="row">
        <div class="col-3">.col-sm-3</div>
        <div class="col-3">.col-sm-3</div>
        <div class="col-3">.col-sm-3</div>
      </div>
    );
  }
}

export default App;
